import React from 'react';
import BG from "../images/planes.jpg";
import LOGO from "../images/ferrari horse.png";
import scuderia from "../images/Ferrari-Scuderia-Symbol.png";

const Main = () => {
  return (
    <>
    <div className='navbar'>
      
      <ul>
        <img src={LOGO} alt="LOGO" />
        <li><a href='#About'>About</a></li>
        <li><a href='#Community'>Community</a></li>
        <li><a href='#Store'>Store</a></li>

      </ul>
    </div>

    <div className='background'>
      <img src={BG} alt="bg" />
    </div>

    <div className='wide-scuderia'>
      <img src={scuderia} alt='s-f' />
    </div>

    </>
  );
}

export default Main;
